                {/* <tr>
                    <td>{product.name}</td>
                    <td>{product.brand}</td>
                    <td>{product.price}</td>
                    <td>{product.category}</td>
                </tr>
             */}
            </tbody>
        </Table>

                {/* <h1>Latest Prodcuts</h1>
                <Row> 
                    {products.map((product)=>(
                        <Col sm={12} md={6} lg={4} xl={3}>
                                    <h2>{product.name}</h2>
                            <Product product={product}/>
                        </Col>
                    ))}
                    
                </Row> */}
                    
        </>
    )
}
